	// ===============DECLARATION & INITIALIZATION - END=============

	// ==========CONVERT ALL DATES IN TO PREFERRED FORMAT============
	currentDateText = substring(_system_date, 0, 10);
	updateDateText = currentDateText;
	if(createdDate_quote <> ""){
		updateDateText = substring(createdDate_quote, 0, 10);
	}
	currentDate = strtojavadate(currentDateText, datePerference); 
	updateDate = strtojavadate(updateDateText, datePerference); 
	updateDate = adddays(updateDate, adminNumDayRefreshPartDB_quote);

	// ===============================================================

	// =======PUT DISCOUNT MENTIONED IN FOR EACH GROUP ON QUOTE IN TO A DICTIONARY WITH KEY AS GROUP NUMBER========= 
	for eachGroup in groups {
		groupNum = eachGroup + 1;
		put(customGroupSubtotalDict, string(groupNum), 0.0);
		put(customGroupDiscountDict, string(groupNum), customGroupDiscountList[eachGroup]);
	} 
	// =====================================================================================================

	//=================READ BRANCH NAME AND ADDRESS DETAILS AND STORE THEM IN DICTIONARY=====================
	//20141121 - CPQS - Combining BMQL's querying the same data table: BranchNum_Name
	//BranchNameRecs = bmql("select Branch_Num, Branch_Name, Branch_Zip, Branch_Street, Branch_City, Branch_State, Branch_Country  from BranchNum_Name");
	BranchNameRecs = bmql("select Branch_Num, Branch_Name, Branch_Short_Name, Branch_Zip, Branch_Street, Branch_City, Branch_State, Branch_Country  from BranchNum_Name");
	for eachRec in BranchNameRecs{
		put(branchCode_Name_dict, get(eachRec, "Branch_Num"), get(eachRec, "Branch_Name"));
		put(branchCode_Zip_dict, get(eachRec, "Branch_Num"), get(eachRec, "Branch_Zip"));
		put(branchCode_Street_dict, get(eachRec,  "Branch_Num"), get(eachRec, "Branch_Street"));
		put(branchCode_City_dict, get(eachRec,  "Branch_Num"), get(eachRec, "Branch_City"));
		put(branchCode_State_dict, get(eachRec,  "Branch_Num"), get(eachRec, "Branch_State"));
		put(branchCode_Country_dict, get(eachRec,  "Branch_Num"), get(eachRec, "Branch_Country"));
	}
	//======================================================================================================
	vendorWeightArray = string[];
	vendorParentDocArray = string[];
	if(vendorWeightString_quote <> ""){
		vendorWeightDataArray = split(vendorWeightString_quote,"#");
		vendorParentDocArray = split(vendorWeightDataArray[0],"$");
		vendorWeightArray = split(vendorWeightDataArray[1],"$");
	}
	modelSQFTDict = dict("float");

	// Set the discount2 type symbols so they can be used in the to concatenate them to the discount 2 type when returning values
	discount2Type = " ";
	bottomLineDiscount2Type = " " + documentCurrencyPref; 

	if (bottomLineDiscountType_quote == "Amt"){
		bottomLineDiscount2Type = " %";
	}

	resTiming1 = start - getcurrenttimeinmillis();
	resTimingString = "Line 225: " + string(resTiming1);
	start = getcurrenttimeinmillis();

	//20141121 - CPQS - 20141121 - CPQS - Moving this on to the top of FOR loop
	SaleTypeResults = bmql("SELECT NewSaleType, SuggestedSaleType, OldSaleType FROM SaleTypes");

	//Cut Size Count with saleTypeHidden_line = "Cut Dimension"
	cutLineCountDict = dict("string");

	// =======================ITERATE OVER EACH LINE ON THE QUOTE AND KEEP LINE INFORMATION IN THE DICTIONARIES==========================
	for line in line_process{
		// initialize all the temporary variables 
		tmp = "";
		overRideNetEachVar = line.overrideNetEach_line;
		eachDocNumList = String[];
		docNumListIndex = 0;
		costEa = 0.0;
		maintenancePercent = 0.0;
		maxDiscountPercent = 0.0;
		qtyChangFlag = false;
		netEachPriceFlag = false;
		extNetPriceFlag = false;
		saleType = "";
		newSaleType = "";
		hiddenSaleType = "";
		CutWidth = 0.0;
		CutLength = 0.0;
		recBranchNum = "";
		recBranchName = "";
		lineCommentFromConfig = line._line_item_comment;
		print "lineCommentFromConfig";
		print lineCommentFromConfig;
		numOfLines = numOfLines + 1;
		put(extNetPriceChangedDict, line._document_number, true);
		extNetPriceChangedFlag = true;
		put(lineCustomField8, line._document_number, line._part_custom_field8);

		put(grabPartPrice, line._document_number, line.grabPriceTablePrice);	//Added by Robert Faigao per case 182193

		// insert every line item document number into document number list 
		append(docNumList, line._document_number);

		//To check if lock & Quote performed once then all Non-Stock should be processed normal pricing logic.
		/*if(inputActionName == "lockQuote"){
			locknQuoteCheck = true;
			tmp = tmp + "1~lockQuoteCheck_quote~" + string(true) + "|";
		}*/

		/*
		** Depending on the line item type to determine which process should be performed.
		** 1) Part - Read all the pricing related information 
		** 2) Model - If there's any model related calculation / manipulation, it should read all read data in the else {}
		*/
		if (line._part_number <> "" ){ //FOR EACH PART LINE
			//if(quoteDescription == "") { quoteDescription = line._part_desc; }
			put (docNumTypeDict, line._document_number, part); //PUT DOCUMENT NUMBER IN A DICTIONARY
			put(customField26Dict, line._document_number, line._part_custom_field26);
			// added by anguemnang the 22.03.2012 resaon: get updated costEa_line values from SOAP.
			append(LineItemSequenceNumbersArray,string(line._sequence_number));//HERE
			put(LineItem_Numdict,string(line._sequence_number),line._part_number);//HERE
			put(lineDocSeqNumDict, line._document_number, line._sequence_number);
			put(lineSeqDocNumDict, line._sequence_number, line._document_number);

			RecBranchNumArray=util.getPartInformation(lineCommentFromConfig, "BRANCHCODE");
			if(sizeofarray(RecBranchNumArray) > 0){
				recBranchNum = RecBranchNumArray[0];

				/** ADDED BY JENNA SUAREZ **/
				//20141121 - CPQS - Using BMQL of BranchNameRecs
				//results = bmql("SELECT Branch_Short_Name FROM BranchNum_Name WHERE Branch_Num = $recBranchNum");
				for branch in BranchNameRecs{
					if(get(branch, "Branch_Num") == recBranchNum){
						recBranchName =  get(branch, "Branch_Short_Name");
					}
				}
			}
			put(ShippingBranchdict,string(line._sequence_number),recBranchNum);

			//READ SALE TYPE FROM EACH LINE COMMENT STRING AND PUT IN DICTIONARY
			saleTypeArray=util.getPartInformation(lineCommentFromConfig, "SALE_TYPE");
			specialOrderSaleType = "";specialOrderHiddenSaleType = "";
			if(sizeofarray(saleTypeArray) > 0){
				saleType = saleTypeArray[0];

				/** ADDED BY JENNA SUAREZ **/	
				//20141121 - CPQS - Moving this on to the top of FOR loop
				//results = bmql("SELECT NewSaleType, SuggestedSaleType FROM SaleTypes WHERE OldSaleType = $saleType");

				for type in SaleTypeResults{
					if(get(type, "OldSaleType") == saleType){
						newSaleType =  get(type, "NewSaleType");
						hiddenSaleType = get(type, "SuggestedSaleType");
					}
					if(line._part_custom_field26 == "Special Order" AND find(saleType,"Stock Only") <> -1 AND get(type, "OldSaleType") == "Non-Stock"){
						specialOrderSaleType =  get(type, "NewSaleType");
						specialOrderHiddenSaleType = get(type, "SuggestedSaleType");
					}elif(line._part_custom_field26 == "Special Order" AND find(saleType,"Processed") <> -1 AND get(type, "OldSaleType") == "Non-Stock Process"){
						specialOrderSaleType =  get(type, "NewSaleType");
						specialOrderHiddenSaleType = get(type, "SuggestedSaleType");
					}
				}
			}
			put (docsaleTypeDict, line._document_number, hiddenSaleType);
			put(itemSaleTypeDict,line._document_number,saleType);

			lineSaleType = saleType;
			lineHiddenSaleType = hiddenSaleType;
			if(specialOrderSaleType <> "" AND specialOrderHiddenSaleType <> ""){
				lineSaleType = specialOrderSaleType;
				lineHiddenSaleType = specialOrderHiddenSaleType;
			}elif(newSaleType <> ""){
				lineSaleType = newSaleType;
			}
			tmp = tmp + line._document_number + "~saleType_line~" + lineSaleType + "|"
				+ line._document_number + "~saleTypeHidden_line~" + lineHiddenSaleType + "|";

			if(hiddenSaleType == "External"){
				put(externalProcessingExists,line._parent_doc_number,true);
			}
			tmp=tmp + line._document_number + "~partNumber_line~" + line._part_number + "|";

			// 04-07-2020 - CAS - made fabrication drawings attached applicable to Non-Stock Process and Process quotes

			if(hiddenSaleType == "Non-Stock" OR hiddenSaleType == "Process"){
			fabDrawingVal = getconfigattrvalue(line._parent_doc_number, "fabricationDrawingsAttached");
				if(isNull(fabDrawingVal)){
					fabDrawingVal = "false";
				}
				if(requiredFabDrawing == false AND fabDrawingVal == "true"){
					requiredFabDrawing = true;
				}
			}	

			//CPS Part Level Attributes
			print "hidden Sale Type";
			print hiddenSaleType;
			if(hiddenSaleType == "Custom"/* OR hiddenSaleType == "Non-Stock" OR hiddenSaleType == "Non-Stock Process"*/){
				//print "DEBUG: CPS Part Level Attributes***************************";
				cutlistVal = getconfigattrvalue(line._parent_doc_number, "cutList");
				if(isNull(cutlistVal)){
					cutlistVal = "false";
				}
				if(requiredCutList == false AND cutlistVal == "true"){
					requiredCutList = true;
				}
				print "line._parent_doc_number";
				print line._parent_doc_number;

				fabDrawingVal = getconfigattrvalue(line._parent_doc_number, "fabricationDrawingsAttached");
				if(isNull(fabDrawingVal)){
					fabDrawingVal = "false";
				}
				if(requiredFabDrawing == false AND fabDrawingVal == "true"){
					requiredFabDrawing = true;
				}

				defaultToleranceVal = getconfigattrvalue(line._parent_doc_number, "tolerance");
				defaultToleranceVal1 = "";
				defaultToleranceVal1 = lower(defaultToleranceVal);

				if(lower(defaultToleranceVal1) <> "standard mill tolerance"){
					requiredUpdateTolerance = false;
					}
				if(requiredUpdateTolerance == false AND (lower(defaultToleranceVal) == "standard mill tolerance")){
					requiredUpdateTolerance = true;
				}

				customerDescVal = getconfigattrvalue(line._parent_doc_number, "customerDescription");
				vendorDescriptionVal = getconfigattrvalue(line._parent_doc_number, "vendorDescription");
				supplierProcessedVal = getconfigattrvalue(line._parent_doc_number, "customProcessed");
				vendorSize = getconfigattrvalue(line._parent_doc_number, "vendorSize");
				vendorWidth = getconfigattrvalue(line._parent_doc_number, "supplierWidth");
				vendorLength = getconfigattrvalue(line._parent_doc_number, "supplierLength");
				vendorQty = getconfigattrvalue(line._parent_doc_number, "vendorQuantity");
				characteristicsData = getconfigattrvalue(line._parent_doc_number, "characteristicsData");
				supplierAndCustomerInstructions = getconfigattrvalue(line._parent_doc_number, "supplierAndCustomerInstructions");

				customCutLineString = "";
				if(supplierProcessedVal == "Supplier Processed" AND cutlistVal == "false"){
					customCutLineString = getconfigattrvalue(line._parent_doc_number, "customCutLineString");
				}elif(supplierProcessedVal == "McNICHOLS Processed"){
					customCutLineString = getconfigattrvalue(line._parent_doc_number, "mcNICHOLSCutLineString");
				}

				put(processingTypeDict,line._parent_doc_number,supplierProcessedVal);
				put(cutListDict,line._parent_doc_number,cutlistVal);
				put(fabDrawingDict,line._parent_doc_number,fabDrawingVal);

				if(isNull(vendorDescriptionVal) OR isNull(customerDescVal)){
					vendorDescriptionVal = "";
					customerDescVal = "";
				}
				if(NOT isNull(vendorSize) AND NOT isNull(supplierProcessedVal) AND supplierProcessedVal == "McNICHOLS Processed"){
					vendorDescriptionVal = vendorDescriptionVal; // + ", " + vendorSize;
				}
				rfqQty = line._price_quantity;
				if(supplierProcessedVal == "McNICHOLS Processed" AND isNumber(vendorQty)){
					rfqQty = atoi(vendorQty);
				}
				if(inputActionName == "default" AND line.partNumber_line == ""){
					tmp=tmp + line._document_number + "~vendorDescription_line~" + vendorDescriptionVal + "|";
					tmp=tmp + line._document_number + "~customerDescription_line~" + customerDescVal + "|";
					tmp=tmp + line._document_number + "~quantityCPS_line~" + string(rfqQty) + "|";
				}

				if(inputActionName == "reconfigure"){
					isCustomQtyChanged = false;
					if(line.quantityCPS_line <> rfqQty){
						isCustomQtyChanged = true;
					}

					put(customInputDataDict,"documentNumber",line._document_number);
					put(customInputDataDict,"supplierQty",rfqQty);
					put(customInputDataDict,"EA",rfqQty*1.0);
					put(customInputDataDict,"LOT",1.0);
					put(customInputDataDict,"isCustomQtyChanged",isCustomQtyChanged);
					put(customInputDataDict,"customCutLineString",customCutLineString);
					put(customInputDataDict,"cutlistVal",cutlistVal);
					put(customInputDataDict,"fabDrawingVal",fabDrawingVal);
					put(customInputDataDict,"parentDocNumber",line._parent_doc_number);
					put(customInputDataDict,"oldModelLength",line.modelLength_line);
					put(customInputDataDict,"oldModelWidth",line.modelWidth_line);
				}

